import React from "react";

const Bienvenido = () => {
  return (
    <div className="min-h-screen bg-blue-50">
      <header className="bg-blue-700 text-white py-6 px-4 text-center">
        <h1 className="text-4xl font-bold">Subestación San Martín</h1>
      </header>

      <main className="max-w-4xl mx-auto mt-10 p-6">
        <div className="bg-white rounded-lg shadow-lg p-8 text-center">
          <h2 className="text-3xl font-bold text-gray-800 mb-4">
            ¡Bienvenido al Proyecto San Martín!
          </h2>
          <p className="text-gray-600 text-lg">
            Has iniciado sesión correctamente.
          </p>
        </div>
      </main>

      <footer className="fixed bottom-0 w-full bg-blue-700 text-white py-4 text-center">
        <p>&copy; 2025 Subestación San Martín - CEDENAR. Todos los derechos reservados.</p>
      </footer>
    </div>
  );
};

export default Bienvenido;
